templates['tmp_start_site_by_service_impresos'] = template({"compiler":[7,">= 4.0.0"],"main":function(container,depth0,helpers,partials,data) {
    return "<div class=\"jx-section-title-1\">            \n    <div class=\"jx-seperator-icon\"><i class=\"fa fa-chevron-down\"></i></div>\n    <div class=\"jx-title-position\">\n        <div class=\"jx-left-border\"></div>\n        <div class=\"jx-title jx-uppercase\">Impresos</div>\n        <div class=\"jx-right-border\"></div>\n    </div>\n</div>    \n<div class=\"jx-container jx-service-flexslider\">\n    <div class=\"flexslider\">\n        <ul class=\"slides\" id=\"init-jx-service-banners\">\n            <li><img src=\"img/servicios/banners/impresos/servicios-alta-resolucion.jpg\" alt=\"\" /></li>\n            <li><img src=\"img/servicios/banners/impresos/servicios-corte-1.jpg\" alt=\"\" /></li>\n            <li><img src=\"img/servicios/banners/impresos/servicios-corte-2.jpg\" alt=\"\" /></li>\n            <li><img src=\"img/servicios/banners/impresos/servicios-digital-1.jpg\" alt=\"\" /></li>\n            <li><img src=\"img/servicios/banners/impresos/servicios-digital-2.jpg\" alt=\"\" /></li>\n            <li><img src=\"img/servicios/banners/impresos/servicios-gran-formato.jpg\" alt=\"\" /></li>\n            <li><img src=\"img/servicios/banners/impresos/servicios-offset-1.jpg\" alt=\"\" /></li>\n            <li><img src=\"img/servicios/banners/impresos/servicios-offset-2.jpg\" alt=\"\" /></li>\n        </ul>\n    </div>\n</div>\n<!-- EOF Flexslider -->\n<div class=\"jx-service-content\"> \n    <div class=\"eight columns alpha\">\n        <div class=\"jx-section-title-2\">\n            <div class=\"jx-title\">GRAN FORMATO</div>\n            <div class=\"jx-seperator-hr\"></div>\n        </div>\n        <p>Las Impresiones en Gran Formato se utilizan para imprimir lonas, banners, carteles, vallas y  señalización en general a un distancia mínima de 5 mts.</p>\n        <mark class=\"orange mark-block font-style\">¿Qué podemos hacer?</mark>\n        <p>Tenemos la capacidad de imprimir en gran formato y alta resolución en los siguientes materiales:</p>\n        <p>Lona, lona blockout, lona mech, vinil  blanco y transparente autoadherible, vinil blanco y transparente estático (para ventanas), vinil micro perforado y lona translúcida para caja de luz.</p>\n        <hr>\n        <div class=\"jx-section-title-2\">\n            <div class=\"jx-title\">CORTE</div>\n            <div class=\"jx-seperator-hr\"></div>\n        </div>\n        <p>El corte o suajado sirve para generar formas en los materiales. </p>\n        <p>Esta técnica es útil para darle un toque más personalizado a tus impresos y pueden realizarse en todo tipo de formas y papeles.</p>\n        <hr>\n        <div class=\"jx-section-title-2\">\n            <div class=\"jx-title\">ALTA RESOLUCIÓN</div>\n            <div class=\"jx-seperator-hr\"></div>\n        </div>\n        <p>Las impresiones de alta resolución se utilizan para señalización generalmente en interiores.</p>\n        <mark class=\"orange mark-block font-style\">¿Qué podemos hacer?</mark>\n        <p>Tenemos la capacidad de imprimir en  los siguientes materiales:</p>\n        <p>Lona, lona translúcida, lona mech, vinil  blanco y transparente autoaderible, vinil blanco y transparente estático (para ventanas), vinil micro perforado, papel mate, semímate y fotográfico, backlight para caja de luz y canvass.</p>\n    </div>\n    <div class=\"eight columns omega\">\n        <div class=\"jx-section-title-2\">\n            <div class=\"jx-title\">DIGITAL</div>\n            <div class=\"jx-seperator-hr\"></div>\n        </div>\n        <p>La impresión digital es un proceso que consiste en la impresión directa de un archivo digital a papel, por diversos medios, siendo el más común la tinta en impresora inyección de tinta (cartuchos), y tóner en impresora láser.</p>\n        <p>Este proceso es ideal para proyectos de impresión de bajo volumen y tiempos de entrega sumamente cortos, ya que una de las principales ventajas que ofrece es la disponibilidad casi inmediata de los impresos, pues no requiere tiempo de secado o enfriamiento al no trabajar con tintas, como la tradicional impresión offset.</p>\n        <mark class=\"orange mark-block font-style\">¿Qué podemos hacer?</mark>\n        <p>Etiquetas, tarjetas, volantes, posters, trípticos, dípticos, calendarios, diplomas, menús, proyectos especiales, etc…</p>\n        <hr>\n        <div class=\"jx-section-title-2\">\n            <div class=\"jx-title\">OFFSET</div>\n            <div class=\"jx-seperator-hr\"></div>\n        </div>\n        <p>Es un método de impresión que consiste en aplicar una tinta, generalmente oleosa, sobre una plancha metálica compuesta de una aleación de aluminio.</p>\n        <mark class=\"orange mark-block font-style\">¿Qué podemos hacer?</mark>\n        <p>Tarjetas, volantes, pósters, catálogos, revistas, trípticos, dípticos, calendarios, postales, calcomanías, etc…</p>\n    </div>\n</div>";
},"useData":true});
